- options:
    extractCommonTypes: true
    rootName: Project
    extractSimilarityThreshold: 0.7
    extractMinSubsetOccurrences: 10
    makeMaps: false
  out: |
    type Project struct {
    	A    int  `json:"a"`
    	B    int  `json:"b"`
    	C    int  `json:"c"`
    	D    int  `json:"d"`
    	E    int  `json:"e"`
    	F    int  `json:"f"`
    	G    int  `json:"g"`
    	H    int  `json:"h"`
    	Node Node `json:"node"`
    }
    
    type Node struct {
    	A int `json:"a"`
    	B int `json:"b"`
    	C int `json:"c"`
    	D int `json:"d"`
    	E int `json:"e"`
    	F int `json:"f"`
    	G int `json:"g"`
    }
